import React from 'react';

const MovieList = ({movies}) => {
    return (
        movies.map(movie => 
            <div class="card">
                <img src={`https://image.tmdb.org/t/p/w500${movie.poster_path}`} class="card-img-top card-img" alt={movie.title} />
                <div class="card-body">
                    {/* <p class="card-text text-dark "></p> */}
                    <h4 class="text-primary">{movie.title}</h4>
                </div>
            </div>
        )
    )
}

export default MovieList;
